import Dash from "./Dash";
import Tile from "./Tile";
import "./Board.css";

function  Board({tiles,onTileClick,turn,d}) {
    return ( 
        <div className="board">
         <Tile turn={turn} onClick={()=>onTileClick(0)} value={t[0]} className="top-border left-border right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(1)}  value={t[1]} className="top-border left-border right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(2)}  value={t[2]} className="top-border left-border  right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(3)}  value={t[3]} className="top-border left-border  right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(4)}  value={t[4]} className="top-border left-border  right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(5)}  value={t[5]} className="top-border left-border  right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(6)}  value={t[6]} className="top-border left-border  right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(7)}  value={t[7]} className="top-border left-border  right-border bottom-border"/>
         <Tile turn={turn} onClick={()=>onTileClick(8)}  value={t[8]} className="top-border left-border  right-border bottom-border"/>
         <Dash d={d} />
        </div>
     );
}

export default  Board;
